import React from 'react';
import Home from './Home.js';
import {Route, Switch,  BrowserRouter, Link} from 'react-router-dom';
import Login from './Login.js';

class App extends React.Component {
    render() {
        return (
            <div className="App">
               <Link to="/Home">Home</Link>
                <BrowserRouter>
                    <Switch>
                    <Route path="/Home">
                        <Home />
                    </Route>
                    <Route >
                        <Login />
                    </Route>
                    </Switch>
                </BrowserRouter>
            </div>
        );
    }
};

export default App;
